import React from 'react'
import "./Footer.css";
import footerlogo from "My project/ca/src/Assets/cheading.png";

function Footer() {
    return (
        <div className="footer">
            <div className="footer__container">
                <img src={footerlogo} alt=""></img>

            </div>
        </div>
    )
}

export default Footer
